import styled from 'styled-components';

export const MusicStyled = styled.div`
	height: 100vh;
	width: 100vw;
	margin: 120px 0px 120px 0px;

	display: grid;
	grid-template-columns: 1fr 2fr;
	grid-gap: 0;
`;
